import { Navigate} from "react-router-dom";
import useAuth from "../auth/useAuth";

export default function PublicRoute({Type, Component}) {

    const {user} = useAuth();

    if(user || Type=="public") return <Navigate to='/projects' />
    if(!user || Type=="private") return <Navigate to='/projects' />
    return (
        Component
    )
}
